import Paper from "@material-ui/core/Paper";

import formStyles from "../styles/form.module.scss";

const styles = {
  MuiPaper: {
    display: "flex",
    alignItems: "center",
    height: 128,
    backgroundColor: "rgba(26, 120, 194, 1)",
    padding: 40,
    boxSizing: "border-box",
  },
  AccountIcon: {
    width: 80,
    height: 80,
  },
};

export default function Form() {
  return (
    <section>
      <Paper style={styles.MuiPaper}>
        <div className={formStyles.UserIcon} />
      </Paper>
    </section>
  );
}
